INSERT INTO `article_info` VALUES (1,'HBlog安装使用说明','HBlog是一款使用Java开发的、以markdown作为文章写作语法的单页应用blog，目的是供作为学习交流使用，也可以用来构建个人网站。\r\n\r\n本文描述作为项目安装使用说明，由于论文答辩以及琐事，尚有一部分功能未能够实现，会在以后慢慢完善。欢迎提交 _Pr_ 以及 <em>Issue</em>\r\n\r\n[view this project on github](https://github.com/penglongli/HBlog)\r\n\r\n## 简介\r\nHBlog基于<em>Spring Framework</em> + <em>Mybatis</em>，前端使用 <em>Less</em> 作为预处理样式， <em>marked.js</em> 来处理markdown格式内容，并且通过 <em>AngularJS</em> 控制视图跳转实现PC端单页应用， <em>gulp</em> 作为前端自动化构建工具;\r\n移动端页面采用 <em>HTML5</em>  +  <em>CSS3</em>  标准实现。\r\n\r\n### 使用到的开源项目:\r\n- [Spring Framework](http://spring.io/) famework\r\n- [MyBatis](http://www.mybatis.org/mybatis-3/) persistence framework\r\n- [jQuery](http://jquery.com) \r\n- [Less](http://lesscss.org/)\r\n- [Font Awesome](http://www.bootcss.com/p/font-awesome/)\r\n- [AngularJS](https://angularjs.org/)\r\n- [angular-loading-bar.js](https://github.com/chieffancypants/angular-loading-bar)\r\n- [marked.js](https://github.com/chjj/marked)\r\n- [highlight.js](https://highlightjs.org/)\r\n- [gulp](http://gulpjs.com/)\r\n\r\n### 开发环境:\r\n- **JDK:** java version \"1.7.0_80\" \r\n- **JVM:** HotSpot(TM) 64-Bit Server VM (build 24.80-b11, mixed mode)\r\n- **MySQL:** 5.6.24\r\n- **IDE:** IntelliJ IDEA 15.0.2\r\n\r\n## 安装使用\r\n\r\n**Completed**:\r\n\r\n* 首页 (PC端和移动端)\r\n* 归档 (PC端和移动端)\r\n* 分类 (PC端和移动端)\r\n* 关于 (PC端和移动端)\r\n* 文章管理\r\n\r\n**TODO List:**\r\n* 增加日志记录\r\n* 读书\r\n* 日记\r\n* 单元测试覆盖(coveralls)\r\n\r\n**使用方式:**\r\n\r\n1. 下载 [HBlog.war](https://github.com/penglongli/HBlog/releases/download/0.1.0/HBlog.war);\r\n2. 下载 hblog.sql(见源码目录)， 创建数据库: hblog, 导入hblog.sql;\r\n3. 移动PBog.war重命名为ROOT.war，并移动至tomcat/webapps目录下，启动tomcat。 启动后webapps目录下会生成ROOT目录;\r\n4. 修改**ROOT/WEB-INF/classes/properties/hblog-local.properties**文件中的数据库账户密码\r\n5. 重启tomcat，打开浏览器访问。\r\n6. 文章管理uri: **/manage/article/list**(由于使用nginx作为登录，所以并未写用户登录模块。所以未配置nginx的用户使用的时候是可以自由访问的)\r\n\r\n*具体使用请参见:* [HBlog-releases](https://github.com/penglongli/HBlog/releases/)\r\n\r\n## 项目构建\r\n**NOTE:** \r\n\r\n* [Maven 3+](http://maven.apache.org/download.cgi)\r\n* 添加Maven的bin路径到Path中\r\n\r\nclone项目源码后，在项目根目录执行:\r\n```\r\nmvn package -DskipTests\r\n```\r\n\r\n## 交流贡献\r\n\r\n源码下载、使用、阅读、修改请参见 [wiki文档](https://github.com/penglongli/HBlog/wiki)\r\n\r\n## 版权\r\nThis project is open-sourced under [Apache License 2.0](http://www.apache.org/licenses/LICENSE-2.0)',93246051,'2016-05-04 19:43:36','2016-05-04 19:43:36',93246051,'HBlog,使用说明',0,1,'<p>HBlog是一款使用Java开发的、以markdown作为文章写作语法的单页应用blog，目的是供作为学习交流使用，也可以用来构建个人网站。</p>\r\n<p>本文描述作为项目安装使用说明，由于论文答辩以及琐事，尚有一部分功能未能够实现，会在以后慢慢完善。欢迎提交 <em>Pr</em> 以及 <em>Issue</em></p>\r\n','HBlog是一款使用Java开发的、以markdown作为文章写作语法的单页应用blog，目的是供作为学习交流使用，也可以用来构建个人网站。\r\n\r\n本文描述作为项目安装使用说明，由于论文答辩以及琐事，尚有一部分功能未能够实现，会在以后慢慢完善。欢迎提交 <em>Pr</em> 以及 <em>Issue</em>\r\n'),(4,'Java的内存区域和内存溢出异常','JVM的自动内存管理机制让开发者不需要去为每一个对象释放(delete/free)内存，如果出现内存泄漏和溢出的问题，需要了解\r\nJVM对内存的使用情况才能够更好地解决问题\r\n\r\n## 1. 内存区域\r\nJVM在执行Java程序的过程中会把管理的内存划分为不同的数据区域。每个区域有各自的用途，以及创建和销毁的时间，有的区域随着进程的启动而存在，有的区域依赖用户线程的启动和结束而建立和销毁。\r\n![](/static/image/8c1ba0ed13644803850f06aaaf0f0596.png)\r\n### 1.1 程序计数器\r\n程序计数器仅占用一块较小的空间，是独立的内存空间，每个线程都有且仅有一个程序计数器，并且是线程私有的（不共享）。\r\n\r\n程序计数器(PC)当执行的是Java方法时，存储当前指令（或操作码）的地址；当执行的是原生（Native）方法时，计数器的值为Undefined。计数器在指令执行过后会增加，并且会持有下一条将要执行的指令的地址。JVM使用计数器来跟踪指令的执行情况，存储的是Java方法的地址，这个地址指向方法区(Method Area)。\r\n\r\n计数器是唯一一个在JVM规范中没有规定任何OutOfMemory情况的区域。\r\n\r\n### 1.2 Java虚拟机栈\r\n\r\nJava的虚拟机栈是线程私有的，在线程创建的时候创建。每一个Java方法在执行的时候都会创建一个栈帧(Stack Frame)来存储局部变量和返回值，方法的调用到完成的过程就是对应的栈帧在虚拟机栈push到pop的过程。\r\n\r\n虚拟机栈除了push和pop操作栈帧外并不被直接操作，所以栈帧可能是堆内存分配的，这就造成了Java虚拟机栈的地址并不一定是连续的。虚拟机规范也并没有要求虚拟机栈的地址是连续的。\r\n\r\n根据虚拟机规范，Java虚拟机栈的大小可以被用户控制设置成固定大小或者在最小和最大尺寸之间动态扩展。以下的异常情况和Java虚拟机栈相关：\r\n* 如果一个线程的计算需要比允许的值更大的Java虚拟机栈，将会抛出StackOverflowError错误\r\n* 如果虚拟机栈可以动态扩展，但是在扩展的时候无法申请到足够的内存，将会抛出OutOfMemoryError错误\r\n\r\n### 1.3 本地方法栈\r\n本地方法栈与虚拟机栈的作用相似，它们之间的区别是本地方法栈为Native方法服务，虚拟机栈为Java指令服务。\r\n\r\n并不是所有的JVM都支持Native Method Stack，但是不支持的JVM也会创建一个本地方法栈。对于一个使用JNI(Java Native Interface, Java和其他语法通信接口)实现的虚拟机的Native方法栈将会是一个\"C栈\"\r\n\r\n### 1.4 Java堆\r\nJava堆是所有JVM线程之间共享的一块内存区域，所有的类实例和数组都是在堆上创建内存。但是根据JIT编译器的发展和逃逸分析技术主键成熟，栈上分配、标量替换这些优化技术将会导致所有的类实例和数组在堆上分配内存不再是那么绝对。\r\n\r\n堆是在虚拟机启动的时候创建，对象的堆存储由自动内存管理系统(垃圾回收器)回收，并且对象并不会被明确释放。根据Java虚拟机规范规定，Java堆存储在物理上不连续的空间中，只需要逻辑连续即可。如果虚拟机实现时设置为可以动态扩展，当堆中内实例分配不到内存并且无法扩展时，将会抛出OutOfMemoryError错误。\r\n\r\n### 1.5 方法区\r\n方法区与Java堆一样，是各个线程共享的内存区域。它存储每个类结构，如运行时常量池、字段、方法返回值以及方法和构造方法的代码，包括在类和实例初始化和接口初始化时所使用的特殊方法。\r\n\r\n方法区在虚拟机启动时创建。根据虚拟机规范，方法区被描述成是堆的一部分。但是根据具体的JVM实现，方法区可以选择不实现垃圾回收和压缩。当方法区的可用内存无法满足内存需要并且无法扩展时，JVM会抛出OutOfMemoryError错误\r\n\r\n### 1.6 运行时常量池\r\n运行时常量池是方法区的一部分，一个类文件或接口文件中包含一项信息：常量池。\r\n\r\n每一个运行时常量池都是从方法区的内存中分配。当JVM创建类或者接口时，运行时常量池就会被构造出来。当运行时常量池构建时，如果无法满足内存分配的需求，将会抛出OutOfMemoryError错误。\r\n\r\n### 1.7 直接内存\r\n直接内存不输入虚拟机运行时数据区的一部分，也不是Java虚拟机规范中定义的内存区域。\r\n\r\nJDK 1.4对直接内存进行了介绍。新的I/O(NIO)类引入了一种基于通道(Channel)与缓冲区(Buffer)的I/O方法。NIO增加了对ByteBuffer(字节缓冲区)的支持，字节缓冲区的DirectByteBuffer(直接缓冲区)增加了堆外的实现。如果缓冲区是直接缓冲区，在调用操作系统的I/O操作之前(或之后)，JVM都会尽量避免在Java堆和Native堆之间来回复制数据。\r\n\r\nByteBuffer类在JDK中定义如下所示：\r\n``` java\r\njava.lang.Object\r\n	java.nio.Buffer\r\n		java.nio.ByteBuffer\r\n```\r\n\r\n虽然直接内存不会受到Java堆大小的限制，但是当本机内存不够的时候，在动态扩展时会出现OutOfMemoryError错误。\r\n\r\n\r\n## 2. 堆中的对象',51397482,'2016-05-27 01:56:17','2016-05-27 01:56:17',37518692,'内存区域,内存溢出',0,1,'<p>JVM的自动内存管理机制让开发者不需要去为每一个对象释放(delete/free)内存，如果出现内存泄漏和溢出的问题，需要了解\r\nJVM对内存的使用情况才能够更好地解决问题</p>\r\n','JVM的自动内存管理机制让开发者不需要去为每一个对象释放(delete/free)内存，如果出现内存泄漏和溢出的问题，需要了解\r\nJVM对内存的使用情况才能够更好地解决问题'),(5,'使用awt中的类操作图片缩放、变圆透明、水印、合并','本文是因为以前写过的一个公众号，需要做这些操作，现在总结一下。当时对awt只限于了解，用到的时候看了看文档和别人的代码，做了几次测试后写的一个整合工具。\r\n\r\n本文会依据先后顺序介绍使用awt的工具类对图片进行缩放、变圆透明、合并、水印，虽然每个都是分步的，但是使用者可以看下api根据实际情况把缩放、变圆透明这些功能放在一个方法中。\r\n\r\n## 图片缩放大小\r\n使用者可以根据具体API和代码的例子自行实现（_下述示例的代码并不规范，仅作为演示功能使用_）\r\n``` java\r\n\r\npublic void testResizeImage() throws IOException {\r\n        File imageFile = new File(\"E:\\\\test\\\\header.png\");\r\n        //缩放后的宽度和高度\r\n        int width = 120, height = 120;\r\n\r\n        BufferedImage imageBuffer = ImageIO.read(imageFile);\r\n        BufferedImage tempBuffer = new BufferedImage(width, height, BufferedImage.TYPE_INT_BGR);\r\n\r\n        //使用tempBuffer创建一个temp画板\r\n        Graphics graphics = tempBuffer.createGraphics();\r\n        //把原文件画在这个画板上\r\n        graphics.drawImage(imageBuffer, 0, 0, width, height, null);\r\n        imageBuffer.flush();\r\n        tempBuffer.flush();\r\n\r\n        String filePath = \"E:\\\\test\\\\header-120x120.png\";\r\n        File temp = new File(filePath);\r\n        temp.createNewFile();\r\n        //把画出来120*120图片的buffer写到temp文件\r\n        ImageIO.write(tempBuffer, \"png\", temp);\r\n    }\r\n\r\n```\r\n\r\n**效果图如下所示：**\r\n\r\n![](/static/image/cd8390d10f6f46eeab7b463f59995475.png)\r\n\r\n## 图片变圆透明\r\n使用者可以根据具体API和代码的例子自行实现（_下述示例的代码并不规范，仅作为演示功能使用_）\r\n``` java\r\n\r\n	/**\r\n	 * 图片变圆，四个角变透明\r\n	 * @throws IOException\r\n	 */\r\n	public void testResizeCircle() throws IOException {\r\n	    File imageFile = new File(\"E:\\\\test\\\\header-120x120.png\");\r\n	    BufferedImage imageBuffer = ImageIO.read(imageFile);\r\n	    int width = imageBuffer.getWidth(), height = imageBuffer.getHeight();\r\n\r\n	    BufferedImage tempBuffer = new BufferedImage(width, height, BufferedImage.TYPE_INT_ARGB);\r\n	    Ellipse2D.Double shape = new Ellipse2D.Double(0, 0, width, height);\r\n\r\n	    Graphics2D g2 = tempBuffer.createGraphics();\r\n	    tempBuffer = g2.getDeviceConfiguration().createCompatibleImage(width, height, Transparency.TRANSLUCENT);\r\n	    g2 = tempBuffer.createGraphics();\r\n	    g2.setComposite(AlphaComposite.Clear);\r\n	    g2.fill(new Rectangle(width, height));\r\n	    g2.setComposite(AlphaComposite.getInstance(AlphaComposite.SRC, 1.0f));\r\n	    g2.setClip(shape);\r\n	    g2.drawImage(imageBuffer, 0, 0, null);\r\n	    g2.dispose();\r\n\r\n\r\n	    ImageIO.write(tempBuffer, \"png\", imageFile);\r\n	}\r\n\r\n```\r\n\r\n**效果图如下所示：**\r\n![](/static/image/a6ec8f9fe27c4762b92ff7fafc54f33b.png)\r\n\r\n\r\n## 图片合并\r\n\r\n使用者可以根据具体API和代码的例子自行实现（_下述示例的代码并不规范，仅作为演示功能使用_）\r\n\r\n``` java\r\n	//合并两个图片(也可以合并多个)\r\n    public void testMerge() throws IOException {\r\n        File newFile = new File(\"E:\\\\test\\\\merge.jpg\");\r\n        File backgroundFile = new File(\"E:\\\\test\\\\background.jpg\");\r\n        File headerFile = new File(\"E:\\\\test\\\\header-120x120.png\");\r\n        BufferedImage backgroundImage = ImageIO.read(backgroundFile); //背景图片\r\n        BufferedImage headerImage = ImageIO.read(headerFile); //头像图片\r\n        int bWidth = backgroundImage.getWidth(), bHeight = backgroundImage.getHeight();\r\n        int hWidth = headerImage.getWidth(), hHeight = headerImage.getHeight();\r\n\r\n        BufferedImage combined = new BufferedImage(bWidth, bHeight, BufferedImage.TYPE_INT_RGB);\r\n        Graphics g = combined.getGraphics();\r\n        //先把背景图画到画板上\r\n        g.drawImage(backgroundImage, 0, 0, null);\r\n\r\n        //计算出头像放置的 Y 轴位置\r\n        Double tempHeight1 = backgroundImage.getHeight() * 0.2;\r\n        Long tempHeight2 = Math.round(tempHeight1);\r\n        Integer headerImageY = Integer.valueOf(tempHeight2.toString());\r\n        g.drawImage(headerImage, (bWidth - hWidth) / 2, headerImageY, null);\r\n\r\n        newFile.createNewFile();\r\n        ImageIO.write(combined, \"jpg\", newFile);\r\n    }\r\n```\r\n\r\n**效果图如下所示：**\r\n\r\n![](/static/image/ddb14648f9874a92870036336a741c80.png)\r\n\r\n## 图片水印\r\n\r\n使用者可以根据具体API和代码的例子自行实现（_下述示例的代码并不规范，仅作为演示功能使用_）\r\n\r\n``` java\r\n//图片加水印\r\n    public void testWaterMark() throws IOException {\r\n        File uploadFile = new File(\"E:\\\\test\\\\background.jpg\");\r\n        Font font = new Font(Font.MONOSPACED, Font.BOLD, 20);// 添加字体的属性设置\r\n\r\n        BufferedImage uploadImage = ImageIO.read(uploadFile);\r\n        int width = uploadImage.getWidth();\r\n        int height = uploadImage.getHeight();\r\n\r\n        BufferedImage combined = new BufferedImage(width, height, BufferedImage.TYPE_INT_RGB);\r\n        Graphics g = combined.getGraphics();\r\n        g.drawImage(uploadImage, 0, 0, null);\r\n        g.setFont(font);\r\n        g.setColor(Color.RED);\r\n        g.drawString(\"HBlog | www.pelinli.com\", 10, 20);\r\n        g.drawString(\"https://github.com/penglongli\", 10, 40);\r\n\r\n        ImageIO.write(combined, \"png\", uploadFile);\r\n    }\r\n```\r\n\r\n**效果图如下所示：**\r\n\r\n![](/static/image/6d1d9df84b984660897177417b1e0bbe.png)\r\n\r\n>原文链接：<http://www.pelinli.com/#/article/31726509>',31726509,'2016-05-30 01:56:03','2016-05-30 01:56:03',85369401,'awt,java操作图片',0,1,'<p>本文是因为以前写过的一个公众号，需要做这些操作，现在总结一下。当时对awt只限于了解，用到的时候看了看文档和别人的代码，做了几次测试后写的一个整合工具。</p>\r\n','本文是因为以前写过的一个公众号，需要做这些操作，现在总结一下。当时对awt只限于了解，用到的时候看了看文档和别人的代码，做了几次测试后写的一个整合工具。');
